def a(n):
    if n==0: return 0
    x=bin(n)[2:]
    r=[]
    s=1
    p=""
    for i in range(1, len(x)):
        if x[i - 1]==x[i]: s+=1
        else:
            r+=[s, ]
            s=1
    l=r+[s]
    L=[]
    if len(l)%2==0:
        for i in range(0, len(l), 2): L+=[l[i + 1], l[i]]
    else:
        b=l[-1]
        for i in range(0, len(l) - 1, 2): L+=[l[i + 1], l[i]]
        L+=[b, ]
    for i in range(len(L)):
        if i%2==0: p+='1'*L[i]
        else: p+='0'*L[i]
    return int(p, 2)
